A Prairie Home Companion, March 22, 2014 Show #1438 Ceann Loch Wobegon

This week on A Prairie Home Companion with Garrison Keillor, it's a live broadcast from The Fitzgerald Theater in Saint Paul, Minnesota. With special guests, masters of Celtic music both ancient and modern, Battlefield Band, Dan &quot;Daddy Squeeze&quot; Newton, blues singer Hilary Thavis, and our good friend Butch Thompson. Plus, the Royal Academy of Radio Actors, Tim Russell, Sue Scott, and Fred Newman, steel guitarist Joe Savage sits in with The Guy's All-Star Shoe Band, and the latest News from Lake Wobegon.
